import React, { useState } from 'react';

const Register = () => {
  const [user, setUser] = useState({
    name: '',
    email: '',
    password: '',
    password2: ''
  });

  return (
    <div className='container'>
      <form>
        <div className=''>
          <label for='inputEmail4'>Email</label>
          <input
            type='email'
            class='form-control'
            id='inputEmail4'
            placeholder='Email'
          ></input>
        </div>
      </form>
    </div>
  );
};

export default Register;
